import React from 'react';
import styled from 'styled-components';
import { useStickyroll } from '@stickyroll/hooks';
// import './App.css';
import SlideOne from './slides/SlideOne';
import SlideTwo from './slides/SlideTwo';
import SlideThree from './slides/SlideThree';
import SlideFour from './slides/SlideFour';
import SlideFive from './slides/SlideFive';
import SlideSix from './slides/SlideSix';

const StyledApp = styled.div`
  max-height: 100vh;
  overflow-y: scroll;

  #progress {
    position: absolute;
    top: 0;
    left: 0;
    z-index: 1;
  }
`;

function App() {
  const slides = [
    <SlideOne />,
    <SlideTwo />,
    <SlideThree />,
    <SlideFour />,
    <SlideFive />,
    <SlideSix />,
  ]

  const [
    wrapper, 
    { 
      height, 
      currentPage, 
      pageCount, 
      pageIndex, 
      progress 
    }
  ] = useStickyroll({ pages: slides });
  console.debug(`height,currentPage,pageCount,pageIndex,progress`, 
    height,
    currentPage,
    pageCount,
    pageIndex,
    progress 
  );
  return (
    <StyledApp className="App" ref={wrapper}>
      <span id='progress'>{progress}</span>
      {/* <Stickyroll pages={slides} factor={1}> 
        {(props) => {
          const {page, pageIndex, progress} = props;
          console.debug('props', props);
          return slides[pageIndex];
        }}
      </Stickyroll> */}
      <SlideOne />
      <SlideTwo />
      <SlideThree />
      <SlideFour />
      <SlideFive />
      <SlideSix />
    </StyledApp>
  );
}

export default App;
